import React from 'react';
import { useFetch } from './hooks';

const PORT = 6287;

let baseUrl = `http://127.0.0.1:${PORT}/get_stocks_data?stocks=["${'AAPL'}"]&startDate=${'2019-01-01'}&endDate=${'2019-02-01'}`;

function Joke() {
  const { message, data } = useFetch(baseUrl, {});
  console.log(data);
  const cleanData = data => {
    if (data) {
      const frame = JSON.parse(data).map(
          (x) => {
            return <table><tr>
              <th key={1}>{x.date}</th>
              <th key={2}>{x.open}</th>
              <th key={3}>{x.high}</th>
              <th key={4}>{x.low}</th>
              <th key={5}>{x.close}</th>
              <th key={6}>{x.volume}</th>
            </tr></table>
          }
      );
      return frame
    }
  };

  const parsedData = cleanData(data);

  return (
    <div>
      <h3>Joke of the session</h3>
      <p><em>{message}</em></p>
            <div>
              <tr>
                <th>Date</th>
                <th>Open</th>
                <th>High</th>
                <th>Low</th>
                <th>Close</th>
                <th>Volume</th>
                <th>Adjusted</th>
              </tr>
              {parsedData}
            </div>
    </div>
  )
}

export default Joke;
